/**
 * Returns the data for a DynamicConfig in the statsig console via typed get functions
 */
export default class DynamicConfig {
    name: string;
    value: Record<string, unknown>;
    private _ruleID;
    private _secondaryExposures;
    constructor(configName: string, value?: Record<string, unknown>, ruleID?: string, secondaryExposures?: Record<string, unknown>[]);
    get<T>(key: string, defaultValue: T | null, typeGuard?: ((value: unknown) => value is T | null) | null): T | null;
    getValue(key: string, defaultValue?: boolean | number | string | object | Array<any> | null): unknown | null;
    getRuleID(): string;
    _getSecondaryExposures(): Record<string, unknown>[];
}
